import { bikiniServices } from '../../data';

const WaxServices = () => {
  return (
    <div className="grid place-items-center">
      <div className="w-3/4 grid grid-cols-1 sm:grid-cols-2 gap-x-10">
        {bikiniServices.map((service, index) => (
          <div key={index}>
            <div className="flex justify-between bg-gray-100 border border-solid border-black mb-6">
              <p>{service.serviceName}</p>

              <p>${service.price}</p>
              <div>
                <p>{service.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WaxServices;
